        [head=1][color=#FF0000]Клонирование как один из путей безвозвратной смерти[/color][/head]


        [head=2][color=#FF0000]░░░░░░СССП░░░░░░[/color][/head]

        [head=2][color=#FF0000]░░░░[/color][/head][head=2][color=#DAA520]▄███████▄[/color][/head][head=2][color=#FF0000]░░░░[/color][/head]

        [head=2][color=#FF0000]░░░[/color][/head][head=2][color=#DAA520]▐███████▀▀░█[/color][/head][head=2][color=#FF0000]░░[/color][/head]

        [head=2][color=#FF0000]░░[/color][/head][head=2][color=#DAA520]▄░▀▀▀▀▄▄▄▀▀▀[/color][/head][head=2][color=#FF0000]░░░[/color][/head]

        [head=2][color=#FF0000]░░░[/color][/head][head=2][color=#DAA520]▀▀▀▀▀▄▄▄██▌[/color][/head][head=2][color=#FF0000]░░░[/color][/head]

        [head=2][color=#FF0000]░░░░[/color][/head][head=2][color=#DAA520]▀███████▀[/color][/head][head=2][color=#FF0000]░░░░[/color][/head]

        [head=2][color=#FF0000]░░░░░░░░░░░░░░░░░[/color][/head]









        Издатель: [italic]Аки Колеша[/italic]

        Автор: [italic]Аки Колеша[/italic]

        Год издания копии: 2708

        [head=3]Введение[/head]

        Книга не предназначена для того что бы вы взяли её за основу своей жизни. Я, как независимый писатель, хочу что бы вы задумались о тематике которая затронута в книге. Надеюсь у вас будет личная точка зрения на этот счёт.

        В основном мы будем рассматривать несколько теорий клонирования, вместе с этим затрону тематику бессмертия как возможного выхода из данной проблемы.

        У читателя который недостаточно знаком с проблемой клонов, станет вопрос, а почему название такое провокационное? Что бы раскрыть эту тайну вам придётся задуматься,  почему явление клонов это и хорошо, с точки зрения знаний, и плохо, с точки зрения [italic]«проигравшего»[/italic] и в конце ответить себе на вопрос, а все это законно? Стоит ли клонировать существ без их согласия. И самый главный вопрос, а вы не клон, когда то умершего самого себя?

        В любом случае каждый из нас должен понимать, что, несмотря на то как существа появились на свет, - обычным путем, в результате клонирования или «из пробирки» - это живое существо, которое вправе рассчитывать на уважение со стороны других разумных существ.














        Страница 2

        [head=3]Основная часть[/head]


        Термин клон происходит от греческого слова «klon», что означает веточка, побег, отпрыск. Клонированию можно давать много определений, вот некоторые самые распространенные из них:


        [italic]Клонирование[/italic] – популяция клеток или организмов  произошедших  от  общего  предка  путём бесполого размножения, причём потомок при этом генетически идентичен своему предку. Клонирование – образование идентичных потомков, клонов, путём бесполого размножения. Результатом клонирования является популяция клеток или организмов с одинаковым набором генов.


        В отличие от животных у растений по мере их роста и развития происходит процесс клеточной специализации, то есть клетки не теряют своих свойств. Они сохраняют способность реализовывать всю генетическую информацию, изначально заложенную в их ядре.


        Что бы принести пример клонирования и так что бы вам был он понятен, дам вам вот такой хорошее определение.


        [italic]Перенос сознания[italic] —  Технология, которая позволяет копировать разум живого существа на информационный носитель, с последующей интеграцией в кибернетическое тело. Для этого потребуется устройство, которое будет моделировать все физиологические и биохимические процессы мозга, с одним условием — чтобы виртуальное сознание реагировало на внешние раздражители подобно оригиналу.


        В данном определение нам нужны две ключевые фразы, то есть: «позволит копировать разум живого существа» и «с последующей интеграцией в кибернетическое тело». По двум данным отрывкам вы как читатель можете понять, «ага, значит сознание копируется и переноситься в другое тело», а что же с старой версией? Оно обречено продолжает жить, в этой бренной  оболочке? И уже с осознанием что он ничего не сможет сделать и будет обречён на смерть.

        Страница 3

        А теперь встает такая идея перед глазами, «а как же клонирование? Оно не является копированием разума, правильно же?». Ну тут я с вами не согласен, за частую после клонирования существа задают вопрос: «кто я?», «где я?», «что я делал и почему я умер?». То есть мы как психолог, если у вас есть данные навыки, можем понять что, существа не помнят свою прошлую жизнь, но имеют: умения, знания, своего оригинала, и с возможностью быстро усвоить информацию, кто друг, а кто враг, по общению с ними.


        По этой логической цепочке вы можете понять, что клонирование, это создание тела на основе оригинала, без учёта повреждений. Но как? Клонирование это создание абсолютно подобного оригинала,  то есть если у существа есть рак, то он должен будет перенестись на новую версию, с абсолютной точностью. Но… почему повреждения проходят? Все достаточно просто, гены давно изучены, и мы можем, при полном наборе генов, создать человека с нуля, повторяю, [italic]только при полном наборе генов[/italic]. А в каком случае мы имеем полный набор генов? Да, вы могли верно понять, только в сканере, тем более, это устройство называется «Медицинский сканер». Пока тело находится в устройстве, оно его сканирует, получая данные. Можно понять, машина по клонированию сначала берет информацию о теле без повреждений, а уже потом первичные профессиональные навыки, а уже в самый последний момент, личность, историю и так далее. А как обычно клонируют? Врачи закидывают тело быстро в сканер, особенно не церемонясь, и клонируют, то есть сканер успевает в лучшем случае получить данные о теле без повреждений, профессиональных знаний, ну и возможно о личности.


        А вот теперь вопрос, ведь есть существа которых не могут быть клонированы, что с ними и почему? Лично я их называю «помечены богом». Я не говорю что есть какое-то проявление «бога» я лишь придумал название этому явлению. Сейчас я пущусь в религию потому что ответом современная медицина или наука не имеет. В учениях космического христианства я периодически видел что такие существа не могут быть клонированный или воссозданы из за их оригинальности, то есть если существо «оригинально», то его нельзя будет клонировать?


        Конечно же нет! Но клонирование будет не в том смысле которое ранее разбиралось. Наши учёные уже смогли разгадать как строится ДНК и РНК. И сейчас МЫ врачи, учёные можем из стандартного набора генов создать

        Страница 4

        личность с нуля и задать воспоминания в процессе инкубации! Но увы при таком клонировании речи о том, что, «о это же тот Том, ну которого съела чёрная дыра», быть и не может. Я имею ввиду то, что данная личность является абсолютно новой, даже не копией старого существа и относиться к таким существам, стоит соответственно, пытаться избегать контактов с ним.


        Следует ли клонировать разумных существ? Следует ли запретить клонирование? Все же, затраты могут быть велики, они могут превышать ожидай. Мало ли, клон забудет, кто вы для оригинала? Мало ли даже после возвращения он даже с всей памятью будет к вам точно так же относиться?


        Собственно… мы рассмотрели очень хорошо проблему клонирования, но как я в начале упоминал, я скажу один выход из данной дилеммы. Бессмертие!


        Да! Вам не показалось, «Бессмертие», это единственный выход из данной ситуации, но как? Ну даже допустим, мы клон, ну, что с того? Мы как клоны оригинала, являемся версией которая [italic]«победила»[/italic], которая выжила! Какая нам разница за [italic]«проигравших»[/italic]? Да, грустно, мы, когда-то  умирали, ну и что! Историю пишут победители! Так если же мы победители, не хотим ли мы остаться такими вечно? Вы ответите, что-нибудь в духе: «да!», «естественно». Это логика победителя, почему мы должны умирать? 


        Так, как я живу уже четвёртый десяток, я могу вас заверить, что есть способ! Как же так получается, что верховное руководство Генерального Штаба живет и по сей момент? 


        Способ бессмертие, постоянное омоложение. Да, я не шучу, ведь, если мы будем отматывать наш возраст, то значит, мы будем жить дольше. И так может доходить до тысячелетий! Просто надо помнить о омоложении. Ничего сложного? 


        У вас, как и у любого живого и разумного, появится вопрос, а как же вирусы? Не всегда удается спастись от них. Или же, могли случайно или целенаправленно убить! Что в таком случае делать?

        Страница 5

        Ответ даже на такое есть. Я ранее говорил, что учёные и врачи уже давно расшифровали ДНК различных видов, так почему себе, через те же вирусы, не изменить генотип? Да не поверите, вирусы являются очень хорошим источником передачи генов. В врачебной практике, я зачастую их использовал, как раз для улучшения каких либо показателей на Генеральном Штабе различным подразделениям нашей постоянной армии. 


        И к выше сказанному, почему не задать вопрос, «а мы можем увеличить прочность кожи, костей?». Опять ответ да! Мы можем и такое. Причем, генетическая защита бывает лучше чем их какого-то металла. Отличным примером является культ плоти, их генетические способности, за частую оказываются более лучшими чем наши технологии.


        По этому я и считаю бессмертие единственным вариантом бессмертия э, и единственным выходом из тупика бесконечного клонирования.


        В конце данного писания я бы хотел завершить пожеланиям о том что бы вы имели свое мнение и небыли слишком подвержены мнению которое сочилось с книги, а лишь могли с него подчеркнуть важные для себя выводы. Желаю удачи мои читателям. В скором времени я найду ещё тему для того, что бы соискатели смогли удовлетворить свои потребности.












